import React from 'react';
import PropTypes from 'prop-types';
import TetrisBlock from './TetrisBlock.js';

function BlocksGroup({blocks}) {
    console.log(blocks);
    return (
        <>
        { blocks.map(({position, color}, i) =>
            <TetrisBlock
                key={i}
                position={position}
                color={color} 
            />) }
        </>
    )
}

export default BlocksGroup;
